const Day23 = (props) => {
  return (
    <div className="day">
      <h2>May 23</h2>
      <h3>Arrival in Barcelona</h3>
      <p>Most flights will be arriving mid morning today in Barcelona</p>
      <p>Suggested for free time:</p>
      <ul>
        <li><a href='http://www.museupicasso.bcn.cat/'>Picasso Museum</a></li>
        <li>Exploring the beaches of Barcelona</li>
        <li>Passieg</li>
      </ul>
    </div>
  );
};

export default Day23;
